import React from 'react';
import styles from "./HomePage.css";
import profilePicture from './assets/Avnoor_Sidhu.jpg';
import dcAppPicture from './assets/dcApp.svg';
import grata1 from './assets/grata-1.png'
import grata2 from './assets/grata-2.png'
// import swiftUILogo from './assets/swiftui-og.png'
import swiftUILogo from './assets/download.jpg'

function Home() {
    return (
        <div class="home">
            <div class="text-column">
                <h1 className='header'>Hello, I am Avnoor</h1>
                <p>I am a Software Engineer at FOCAL Lab. </p>
            </div>
            <div class="image-column">
                <img src={profilePicture} alt="Profile Picture" className="img" />
            </div>
        </div>
    );
  }

function TextLine({ text }) {
    return (
        <div>
            <p>{text}</p>;
        </div>
    )
}

function Experience() { 
    return (
        <div>
            <h3 className="titles">Experience</h3>
            <hr class="custom-line"></hr>
            <div>
                <p>Where I've Worked</p>
                <p>Jan 2024 - present</p>

            </div>
        </div>
    );
}

function Rectangle({ name, image, description, style, logos }) {
    return (
        <div className="rectangle" style={style}>
            <div className="text-content">
                <h3>{name}</h3>
                <p>{description}</p>
            </div>
            <img src={image} className="projectImage" />
            <div className="logo-container">
                {logos.map((logo, index) => (
                    <img key={index} src={logo} alt="Project Logo" className="logo" />
                ))}
            </div>
        </div>
    );
}

function Projects() { 
    const projects = [
        { id: 1, name: 'DC Menu App', description: 'Description of Project One.', color: '#FFD700', image: dcAppPicture, logos: [] },
        { id: 2, name: 'iOS Property Management Application', description: 'Description of Project Two.', color: '#FF6347', image: grata1, logos: [swiftUILogo] },
        { id: 3, name: 'Lab Scheduler', description: 'Description of Project Three.', color: '#4682B4', image: '/path/to/image3.jpg', logos: [] },
        { id: 4, name: 'User Thread Library', description: 'Description of Project Four.', color: '#32CD32', image: '/path/to/image4.jpg', logos: [] },
        { id: 5, name: 'Tune Hunt', description: 'Description of Project Five.', color: '#FF69B4', image: '/path/to/image5.jpg', logos: [] },
        { id: 6, name: 'Tic Tac Toe', description: 'Description of Project Six.', color: '#00BFFF', image: '/path/to/image6.jpg', logos: [] }
    ];
    return (
        <div>
            <div>
                <h3 className="titles">Projects</h3>
                <hr class="custom-line"></hr>
            </div>
            <div className="grid">
                {projects.map(project => (
                    <Rectangle
                        key={project.id}
                        name={project.name}
                        description={project.description}
                        image={project.image}
                        style={{ backgroundColor: project.color }}
                        logos={project.logos}
                    />
                ))}
            </div>
        </div>
    );
}

function Contact() { 
    return (
        <div>
            <div>
                <h3 className="titles">Contact</h3>
                <hr class="custom-line"></hr>
            </div>
            <p>Are you interested in collaborating or want to connect or chat? If so, hit the contact button down below or contact me via LinkedIn.</p>
        </div>
    );
}

function HomePage() {
    return (
        <div className="HomePage">
            <Home />
            <Experience />
            <Projects />
            <Contact />
        </div>
    );
  }

  export default HomePage;
